import {BrowserRouter as Router,Route, Switch} from 'react-router-dom';
import Header from "./Components/Header";

function App() {
  return (
   <Router>
     <div className="App">
       <Header/>
       <div className="content">
         <Switch>
           <Route exact path ="/">

           </Route>
         </Switch>
       </div>
     </div>
   </Router>
  );
}

export default App;
